from sys import stdin
input = stdin.readline

n = int(input())
graph = [[*map(int, input().split())] for i in range(n)]
check = [[0] * n for _ in range(n)]

def search(root):
  def _search(find, depth=0):
    if depth > n: return
    for i in range(n):
      if graph[find][i]:
        if check[find][i] == root + 1: continue
        check[root][i] = check[find][i] = root + 1
        _search(i, depth + 1)
  _search(root)

for i in range(n): search(i)
for i in check: print(*[*map(lambda x: +bool(x), i)])


